$(document).ready(function(){var e=[".first_frame",".second_frame",".third_frame"];for(var t=0;t<e.length;t++)$(e[t]).fadeOut(0);$scrollHor=$(this).scrollTop();$(e[Math.floor($scrollHor/900)]).fadeIn(1e3);$(window).delay(50).scroll(function(){$scrollHor=$(this).scrollTop();$now=Math.round($scrollHor/900);$(e[$now]).fadeIn(1e3);for(var t=0;t<e.length;t++)if($now!=t)$(e[t]).fadeOut(500)});$("#nav").localScroll(200);$("#page1").parallax("50%",.1);$("#page2").parallax("50%",.1);$("#page3").parallax("50%",.1);$("#page4").parallax("50%",.1)})